        <div className="bg-dark text-white"  style={{width:"200px",height:"400px",textAlign:"center"}}>
               <img src={image}/>
               <h3>ayman alaozry</h3>
               <p>asdsdf dfsdf</p>
               <h3>phone +684 34546543</h3>
               <h3>emmil</h3>
        </div>
    )
}
export default ConCard
